import React from 'react';
import '../styles/global.css';
import companyHistoryImage from '../assets/company-history.jpg';
import missionVisionImage from '../assets/mission-vision.jpg';
import teamProfilesImage from '../assets/team-profiles.jpg';

const AboutPage = () => {
  return (
    <div className="about">
      <h1>About Us</h1>
      <div>
        <h2>Company History</h2>
        <img src={companyHistoryImage} alt="Company History" />
        <p>Our company has a rich history in providing top-notch services and solutions in Dubai.</p>
      </div>
      <div>
        <h2>Mission and Vision</h2>
        <img src={missionVisionImage} alt="Mission and Vision" />
        <p>We are committed to enhancing marketing and cooperation through transparency and advanced technologies.</p>
      </div>
      <div>
        <h2>Team Profiles</h2>
        <img src={teamProfilesImage} alt="Team Profiles" />
        <p>Meet our dedicated team of professionals who are here to assist you.</p>
      </div>
    </div>
  );
};

export default AboutPage;
